import './closeFriend.css'

export default function CloseFriend({user}) {
    return (
        <div>
            <li className="Friend">
                <img src={user.profilePicture} alt="" className="friendImg" />
                <span className="friendName">{user.username}</span>
            </li>
        </div>
    )
}
